INSERT INTO `zzzzsys_event` (`zzzzsys_event_id`, `sev_zzzzsys_object_id`, `sev_name`, `sev_javascript`, `zzzzsys_event_log_added_at`, `zzzzsys_event_log_added_by`, `zzzzsys_event_log_changed_at`, `zzzzsys_event_log_changed_by`, `zzzzsys_event_log_viewed_at`, `zzzzsys_event_log_viewed_by`) VALUES
