INSERT INTO `zzzzsys_form` (`zzzzsys_form_id`, `sfo_type`, `sfo_name`, `sfo_title`, `sfo_sql`, `sfo_table`, `sfo_primary_key`, `sfo_width`, `sfo_height`, `sfo_breadcrumb`, `sfo_add_button`, `sfo_save_button`, `sfo_delete_button`, `sfo_clone_button`, `sfo_new_button`, `sfo_print_button`, `sfo_add_title`, `sfo_save_title`, `sfo_delete_title`, `sfo_clone_title`, `sfo_new_title`, `sfo_print_title`, `sfo_add_button_display_condition`, `sfo_save_button_display_condition`, `sfo_delete_button_display_condition`, `sfo_clone_button_display_condition`, `sfo_new_button_display_condition`, `sfo_print_button_display_condition`, `sfo_custom_code_run_before_save`, `sfo_custom_code_run_before_browse`, `sfo_custom_code_run_before_delete`, `sfo_custom_code_run_before_open`, `sfo_custom_code_run_after_save`, `sfo_custom_code_run_after_delete`, `sfo_custom_code_run_javascript`, `sfo_redirect_form_id`, `sfo_row_height`, `sfo_rows`, `zzzzsys_form_log_added_at`, `zzzzsys_form_log_added_by`, `zzzzsys_form_log_changed_at`, `zzzzsys_form_log_changed_by`, `zzzzsys_form_log_viewed_at`, `zzzzsys_form_log_viewed_by`) VALUES
('nusetup', 'browse', 'set', 'Setup', 'SELECT * FROM zzzzsys_setup', 'zzzzsys_setup', 'zzzzsys_setup_id', 1000, 0, '', '0', '1', '0', '0', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '  \r\n    $(document).ready(function(){\r\n\r\n\r\n        $("#set_css").css(''background-color'', ''#EDD0FC'');\r\n        $("#set_css").css(''font-family'', ''Courier New'');\r\n        $("#set_css").css(''font-size'', ''14px'');\r\n        $("#set_css").attr( ''wrap'', ''off'');\r\n\r\n    });\r\n\r\n', '', 0, 0, '0000-00-00 00:00:00', '', '0000-00-00 00:00:00', '', '2013-11-18 16:30:46', 'globeadmin'),
('nuupdatenubuilder', 'browse', 'updateNubuilder', 'Update nuBuilder', 'select * from zzzzsys_setup', 'zzzzsys_setup', 'zzzzsys_setup_id', 900, 500, 'SELECT ''''', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, 'function loadUpdater() {\n    switchButtonToProgress();\n    var xmlhttp;\n    xmlhttp = new XMLHttpRequest();\n    xmlhttp.onreadystatechange=function() {\n        if (xmlhttp.readyState==4 && xmlhttp.status==200)  {\n                displayUpdaterResponse(xmlhttp.responseText);                  \n        } else if (xmlhttp.readyState==4 && xmlhttp.status!=200)  {\n                displayUpdaterServerError();                  \n        }\n    }\n    xmlhttp.open("GET","nuphpgit.php?sessid=#session_id#",true);\n    xmlhttp.send();\n}\nfunction switchButtonToProgress() {\n    var contents = ''<img src="ajax-loader.gif">'';\n    document.getElementById("Runbtn").style.display = ''none'';\n    document.getElementById("updateNubuilderProgress").innerHTML=contents;\n    document.getElementById("updateNubuilderMessageDetails").innerHTML=''Please wait...'';\n}\nfunction switchProgressToButton() {\n    var contents = '''';\n    document.getElementById("updateNubuilderProgress").innerHTML=contents;\n    document.getElementById("updateNubuilderMessageDetails").innerHTML=contents;\n    document.getElementById("Runbtn").style.display = ''block'';\n}\n\nfunction displayUpdaterServerError() {\n    switchProgressToButton();\n    document.getElementById("updateNubuilderMessageDetails").innerHTML=''Update failed, internal server error!'';\n}\n\nfunction displayUpdaterResponse(JsonText) {\n    switchProgressToButton();\n\n    //var contents = ''<textarea rows="20" cols="145">''+JsonText+''</textarea>'';\n    //document.getElementById("updateNubuilderResponse").innerHTML=contents;\n\n    obj = $.parseJSON(JsonText);\n    var result = ''<br><b>Result</b>: '' + obj.message + ''<br><br>'';\n    document.getElementById("updateNubuilderProgress").innerHTML=result;\n\n    if ( obj.message == ''ERRORS'' ) {\n        displayMessageDetails(obj.errors, obj.dbupdate);\n    }\n    if ( obj.message == ''SUCCESS'' ) {\n        displayMessageDetails(obj.success, obj.dbupdate);\n    }\n  \n}\n\nfunction displayMessageDetails(message, dbupdate) {\n\n    var contents = ''<br><br><textarea rows="20" cols="145">''; \n    contents = loopContents(contents, message);\n    contents = loopContents(contents, dbupdate.summary1);\n    contents = loopContents(contents, dbupdate.summary2);\n    contents = loopContents(contents, dbupdate.sqlErrors);\n    contents = loopContents(contents, dbupdate.warnings);\n    contents = contents + ''</textarea>'';\n	\n    document.getElementById("updateNubuilderMessageDetails").innerHTML=contents;\n}\n\nfunction loopContents(contents, obj) {\n\n    if (obj instanceof Array) {\n        for (var i = 0; i < obj.length; i++) {\n            contents = contents + obj[i];\n            contents = contents + ''&nbsp;'';\n            contents = contents + ''\\r'';      \n        }\n    }\n    return contents; \n}', NULL, 0, 0, '2014-07-09 16:21:36', 'globeadmin', '2014-07-15 13:06:56', 'globeadmin', '2014-07-15 13:07:18', 'globeadmin'),
('nunoaccess', 'browse', 'noaccess', 'No access if not globeadmin', 'SELECT * FROM zzzzsys_form\r\nWHERE \r\n(\r\nzzzzsys_form_id NOT LIKE ''#nu_denied#''\r\nOR \r\nzzzzsys_form_id\r\nIN (''nuemail'',''nuhome'',''nugroup'',''nuimage'',''nulevel'',''nunoaccess'',''nuuser'' ,''nurunreport'' ,''nurunphp'',''nureport'' ,''nuphp'',''nunoaccess'')\r\n)\r\nORDER BY sfo_name\r\n', 'zzzzsys_form', 'zzzzsys_form_id', 0, 0, '', '0', '0', '0', '0', '0', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, NULL, 'nuform', 0, 0, '2014-02-07 13:07:46', 'globeadmin', '2014-02-07 13:49:58', 'globeadmin', '2014-02-07 14:06:07', 'globeadmin'),
('nuindex', 'browse', 'ind', 'Index', 'SELECT * FROM zzzzsys_debug', 'zzzzsys_debug', 'zzzzsys_debug_id', 900, 0, '', '0', '0', '0', '0', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '$s = "\n\n    SELECT * \n    FROM zzzzsys_setup\n    WHERE zzzzsys_setup_id = ''1''\n\n";\n\n$t = nuRunQuery($s);\n\n$r = db_fetch_object($t);\n\nif($r->set_splash != ''1''){\n\n    $nb = ''<strong><strong><span style="color: #78C13A; text-shadow: 1px 1px #D0D7D1;">nu</span><span style="color: #03AAE9; text-shadow: 1px 1px #D0D7D1;">Builder</span></strong><span style="color: #FB0003; text-shadow: 1px 1px #D0D7D1;"><i>Pro</i></span></strong>'';\n\n    $h = ''<img id="talkingmike" style="position:absolute;left:10px;top:10px" src="mike.png" width="64" height="133">'';\n    $h = $h . ''<div id="miketalking" style="position:absolute;left:100px;top:10px">'';\n    $h = $h . ''Hi, welcome to '' . $nb . ''.<br><br>The easiest way to get started<br>with '' . $nb . '' is with a <strong>Fast Form</strong>.<br><br>'';\n    $h = $h . ''To learn how to create a <strong>Fast Form</strong> please<br>check out this video.<br><br>'';\n    $h = $h . ''<a href="https://www.youtube.com/watch?v=P7SHJtikcTM" target="_blank"><strong>Here</strong></a>'';\n    $h = $h . ''</div>'';\n    $h = $h . ''<div  style="position:absolute;left:50px;top:200px"><input type="checkbox" id="nuCheckClose"> Do not show this message again</div>'';\n    $h = $h . ''<input id="closesplash" onclick="nuCloseSplash()" type="button" value="OK" style="background-color:#7CC342;color:white;padding:2px;position:absolute;left:350px;top:200px;width:50px"/>'';\n\n    \n    $j = "\n\n	var e = document.createElement(''div'');\n	\n	e.setAttribute(''id'', ''nuSplash'');\n	\n	$(''#nu_tab_area0'').append(e);\n	\n	$(''#nuSplash'').css({\n		''width''            : 450,\n		''height''           : 250,\n		''top''              : -10,\n		''left''             : 250,\n		''position''         : ''absolute'',\n		''background-color'' : ''white'',\n		''color''            : ''black'',\n		''z-index''          : 5000,\n		''border-width''     : ''1px'',\n		''border-color''     : ''black'',\n		''border-style''     : ''solid'',\n		''filter''           : ''Alpha(Opacity=100)'',\n		''opacity''          : ''1'',\n		''box-shadow''       : ''5px 5px 5px #888888''\n	})\n\n	$(''#nuSplash'').html(''$h'');\n\n    \n    ";\n\n    nuAddJavascript($j);\n    \n}\n\n', 'nuRunQuery("UPDATE zzzzsys_setup SET set_splash = ''1''");', '', 'function nuLoadEdit() { \n    \n    $(''#homeform'').css(''background-color'',''#7CC342'');\n    \n    $(''#fafbtn'').attr(''title'',"Create a Form and it''s Table with no programming");\n\n}\n\nfunction nuCloseSplash(){\n    \n    var s = $(''#nuCheckClose'').is('':checked'');\n    \n    $(''#nuSplash'').remove();\n\n    if(s){\n        nuSaveForm();        \n    }\n\n}', '', 0, 0, '0000-00-00 00:00:00', '', '2015-04-20 10:12:37', 'globeadmin', '2015-04-20 10:12:37', 'globeadmin'),
('nudebug', 'browse', 'bug', 'Debug', 'SELECT * FROM zzzzsys_debug \nORDER BY deb_added DESC\n', 'zzzzsys_debug', 'zzzzsys_debug_id', 0, 0, '', '0', '1', '0', '0', '0', NULL, NULL, 'Delete Chosen Period', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, '', NULL, '$seconds = ''#deb_delete#'';\r\n\r\n$sql = ''SELECT * FROM zzzzsys_debug'';\r\n$t   = nuRunQuery($sql);\r\n\r\nwhile($r = db_fetch_object($t)){\r\n    if(strtotime(date("Y-m-d H:i:s")) - strtotime($r->deb_added) > $seconds) {\r\n        nuRunQuery("DELETE FROM zzzzsys_debug WHERE zzzzsys_debug_id = ''$r->zzzzsys_debug_id''");\r\n    }\r\n}\r\n', NULL, NULL, NULL, 0, 0, '0000-00-00 00:00:00', '', '2014-01-10 13:05:22', 'globeadmin', '2014-01-10 13:05:23', 'globeadmin'),
('nugroup', 'browse', 'ugr', 'User Groups', 'SELECT * FROM zzzzsys_user_group \nLEFT JOIN  zzzzsys_access_level ON sug_zzzzsys_access_level_id = zzzzsys_access_level_id', 'zzzzsys_user_group', 'zzzzsys_user_group_id', 900, 0, 'SELECT ''#sug_code#''', '1', '1', '1', '1', '', NULL, '', '', '', '', '', NULL, '', 'SELECT 1', '', '', '', NULL, NULL, NULL, '', NULL, NULL, NULL, '', NULL, 0, 0, '0000-00-00 00:00:00', '', '2013-10-22 14:59:12', 'globeadmin', '2013-10-22 14:59:12', 'globeadmin'),
('nufastform', 'browse', 'faf', 'Fast Form', 'SELECT * \nFROM zzzzsys_form\nWHERE zzzzsys_form_id NOT LIKE ''nu%''\nAND sfo_table NOT LIKE ''zzzzsys_%''\nORDER BY sfo_title\n', 'zzzzsys_form', 'zzzzsys_form_id', 0, 0, '', '1', '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$s = nuGetJSONSubform(''fast_form_subform'');\n$j = json_decode($s);\n\nfor($i = 0 ; $i-1 < count($j) ; $i++){                                            //-- loop through JSON\n    \n    if($j[$i]->nuDelete == ''1'' and $j[$i]->nuPrimaryKey != ''''){\n        nuRemoveFastField($j[$i]->nuPrimaryKey);\n    }    \n}\n\n\n\nfunction nuRemoveFastField($i){\n    \n    $s = "\n        SELECT * \n        FROM zzzzsys_object\n        WHERE zzzzsys_object_id = ''$i''\n    ";\n    \n    $t = nuRunQuery($s);\n    $o = db_fetch_object($t);\n    \n    $s = "\n        SELECT * \n        FROM zzzzsys_form\n        WHERE zzzzsys_form_id = ''$o->sob_zzzzsys_form_id''\n    ";\n    \n    $t = nuRunQuery($s);\n    $f = db_fetch_object($t);\n    \n    $s = "\n        DELETE FROM zzzzsys_browse\n        WHERE sbr_zzzzsys_form_id = ''$f->zzzzsys_form_id''\n        AND sbr_display = ''$o->sob_all_name''\n    ";\n\n    nuRunQuery($s);                                                             //-- remove Browse Column\n\n}\n\n', NULL, '', NULL, '$GLOBALS[''nuObjectOrder'']      = 100;\r\n\r\n\r\n$a  = array();\r\n$t  = nuRunQuery("SELECT * FROM zzzzsys_form WHERE zzzzsys_form_id = ''#RECORD_ID#''");\r\n$FO = db_fetch_object($t);\r\n\r\nif($FO->sfo_table == ''''){                                                        //-- add a new form and table\r\n\r\n    $FO->sfo_table = nuFastFormForm($FO);\r\n\r\n}\r\n\r\n$s = "\r\n    SELECT * \r\n    FROM zzzzsys_object \r\n    WHERE sob_zzzzsys_form_id = ''$FO->zzzzsys_form_id''\r\n    ORDER BY sob_all_name DESC, zzzzsys_object_id\r\n";\r\n\r\n$t = nuRunQuery($s);\r\n\r\nwhile($OO = db_fetch_object($t)){\r\n    \r\n    if($OO->sob_all_name == ''''){\r\n    \r\n        $OO->sob_all_name  = nuGetUniqueName($OO->sob_all_title, $a);\r\n        nuAddFastFormObject($FO, $OO);\r\n        \r\n    }\r\n        \r\n    $a[] = $OO->sob_all_name;\r\n    \r\n    $GLOBALS[''nuObjectOrder''] = $GLOBALS[''nuObjectOrder''] + 1;\r\n    \r\n}\r\n\r\n$s = "\r\n    DELETE FROM zzzzsys_object\r\n    WHERE IFNULL(sob_all_name,'''') = '''' \r\n    AND IFNULL(sob_all_type,'''') = ''''\r\n";\r\n\r\nnuRunQuery($s);\r\n\r\n\r\n\r\n//--------------------------------- Functions-----------------------------------\r\n\r\nfunction nuAddFastFormObject($FO, $OO){                                //-- Add Form Object and Browse Column\r\n\r\n    $bid = nuID();\r\n\r\n    $d   = $FO->sfo_table.''_id'';\r\n    $ord = $GLOBALS[''nuObjectOrder''];\r\n    $tit = nuValidTitle($OO->sob_all_title);\r\n\r\n    $s   = "\r\n    \r\n        UPDATE zzzzsys_object\r\n        SET \r\n        sob_all_name = ''$OO->sob_all_name'',\r\n        sob_all_tab_title = ''Main'',\r\n        sob_all_tab_number = ''10'',\r\n        sob_all_column_number = ''10'',\r\n        sob_all_order_number = ''$ord'',\r\n        sob_all_clone = ''1'',\r\n        sob_all_align = ''l'',\r\n        sob_all_no_blanks = ''0'',\r\n        sob_all_read_only = ''0'',\r\n        sob_all_no_duplicates = ''0'',\r\n        sob_all_left = ''0'',\r\n        sob_all_top = ''0''\r\n        WHERE zzzzsys_object_id = ''$OO->zzzzsys_object_id''\r\n\r\n    ";\r\n\r\n    nuRunQuery($s);                                                             //-- add Object\r\n\r\n    $s   = "\r\n    \r\n    	INSERT INTO zzzzsys_browse\r\n    	(\r\n    	zzzzsys_browse_id,\r\n    	sbr_zzzzsys_form_id,\r\n    	sbr_title,\r\n    	sbr_display,\r\n    	sbr_sort,\r\n    	sbr_align,\r\n    	sbr_order,\r\n    	sbr_width\r\n    	)\r\n    	VALUES\r\n    	(\r\n    	''$bid'',\r\n    	''$FO->zzzzsys_form_id'',\r\n    	''$tit'',\r\n    	''$OO->sob_all_name'',\r\n    	''$OO->sob_all_name'',\r\n    	''l'',\r\n    	''$ord'',\r\n    	150\r\n    	)\r\n	\r\n    ";\r\n    \r\n    nuRunQuery($s);                                                             //-- add Browse\r\n\r\n    nuUpdateObject($bid, $OO, $FO);\r\n    \r\n}\r\n\r\n\r\n\r\nfunction nuUpdateObject($bid, $OO, $FO){\r\n\r\n    $t = 40;\r\n\r\n    if($OO->sob_all_type == ''Text''){\r\n    \r\n        $osql = "sob_all_type = ''text'', sob_all_width = 200";\r\n        $bsql = "sbr_align = ''l''";\r\n        $asql = "ADD $OO->sob_all_name VARCHAR(300) NOT NULL";\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Date''){\r\n    \r\n        $osql = "sob_all_type = ''text'', sob_all_width = 90, sob_text_format = ''6''";\r\n        $bsql = "sbr_align = ''l'', sbr_format = ''6''";\r\n        $asql = "ADD $OO->sob_all_name DATE NOT NULL";\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Number''){\r\n    \r\n        $osql = "sob_all_type = ''text'', sob_all_width = 80, sob_text_format = ''2'', sob_all_align = ''r''";\r\n        $bsql = "sbr_align = ''r'', sbr_format = ''2''";\r\n        $asql = "ADD $OO->sob_all_name DECIMAL(12,2) NOT NULL";\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Auto Number''){\r\n    \r\n        $auto = ''auto_'' . $OO->zzzzsys_object_id . ''_'' . $FO->sfo_table ;\r\n        $osql = "sob_all_type = ''text'', sob_all_width = 60, sob_all_align = ''r'', sob_all_read_only = ''1'', sob_all_default_value_sql = ''#$auto#''";\r\n        $bsql = "sbr_align = ''r''";\r\n        $asql = "ADD $OO->sob_all_name INT NOT NULL";\r\n        \r\n        $atab = "\r\n                CREATE TABLE $auto (\r\n                id int(11) NOT NULL AUTO_INCREMENT,\r\n                extra_field varchar(25) NOT NULL,\r\n                PRIMARY KEY (id),\r\n                KEY extra_field (extra_field)\r\n                )\r\n        ";\r\n        \r\n        nuRunQuery($atab);\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Password''){\r\n    \r\n        $osql = "sob_all_type = ''text'', sob_all_width = 100, sob_text_type = ''password''";\r\n        $bsql = "";\r\n        $asql = "ADD $OO->sob_all_name VARCHAR(300) NOT NULL";\r\n        $s = "DELETE FROM zzzzsys_browse WHERE zzzzsys_browse_id = ''$bid''";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n   if($OO->sob_all_type == ''Checkbox''){\r\n    \r\n        $osql = "sob_all_type = ''checkbox'', sob_all_width = 10";\r\n        $bsql = "sbr_display = ''$OO->sob_all_name'', sbr_sort = ''$OO->sob_all_name''";\r\n        $asql = "ADD $OO->sob_all_name VARCHAR(1) NOT NULL";\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Text Area''){\r\n    \r\n        $osql = "sob_all_type = ''textarea'', sob_all_height = 200, sob_all_width = 200";\r\n        $bsql = "sbr_align = ''l''";\r\n        $asql = "ADD $OO->sob_all_name TEXT NOT NULL";\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Drop Down''){\r\n    \r\n        $osql = "sob_all_type = ''dropdown'', sob_all_width = 50, sob_dropdown_sql = ''0|No|1|Yes''";\r\n        $bsql = "sbr_display = ''$OO->sob_all_name'', sbr_sort = ''$OO->sob_all_name''";\r\n        $asql = "ADD $OO->sob_all_name VARCHAR(300) NOT NULL";\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Listbox''){\r\n    \r\n        $LBN = ''listbox_'' . $OO->zzzzsys_object_id . ''_'' . $OO->sob_all_name;\r\n\r\n        $s    = "\r\n                CREATE TABLE $LBN (\r\n                id VARCHAR(25) NOT NULL, \r\n                choice VARCHAR(200) NOT NULL, \r\n                PRIMARY KEY (id)\r\n                )\r\n                 ENGINE = MyISAM;\r\n                ";\r\n                \r\n        nuRunQuery($s);\r\n        \r\n    \r\n        $s    = "\r\n                INSERT INTO $LBN\r\n                (id, choice) \r\n                VALUES \r\n                (''1'', ''Choice 1''), (''2'', ''Choice 2''), (''3'', ''Choice 3'');\r\n                ";\r\n                \r\n        nuRunQuery($s);\r\n        \r\n\r\n        $osql = "sob_all_type = ''listbox'', sob_all_width = 200, sob_all_height = 70, sob_listbox_sql = ''SELECT id, choice FROM $LBN''";\r\n        $asql = "ADD $OO->sob_all_name TEXT NOT NULL";\r\n        $s = "DELETE FROM zzzzsys_browse WHERE zzzzsys_browse_id = ''$bid''";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Word''){\r\n    \r\n        $osql = "sob_all_type = ''words'', sob_all_width = 200";\r\n        $bsql = "";\r\n        $asql = "";\r\n        $s = "DELETE FROM zzzzsys_browse WHERE zzzzsys_browse_id = ''$bid''";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Display''){\r\n    \r\n        $osql = "sob_all_type = ''display'', sob_all_width = 200, sob_display_sql = ''SELECT CURDATE()''";\r\n        $bsql = "";\r\n        $asql = "";\r\n        $s = "DELETE FROM zzzzsys_browse WHERE zzzzsys_browse_id = ''$bid''";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''HTML''){\r\n    \r\n        $osql = "sob_all_type = ''html'', sob_all_width = 200, sob_all_height = 200, sob_html_code = ''<div style=\\"background-color:lightblue;height:200px;width:200px\\">Hello World</div>''";\r\n        $bsql = "";\r\n        $asql = "";\r\n        $s = "DELETE FROM zzzzsys_browse WHERE zzzzsys_browse_id = ''$bid''";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Hidden Field''){\r\n    \r\n        $osql = "sob_all_type = ''text'', sob_all_display_condition = ''SELECT 0''";\r\n        $bsql = "";\r\n        $asql = "ADD $OO->sob_all_name VARCHAR(300) NOT NULL";\r\n        $s = "DELETE FROM zzzzsys_browse WHERE zzzzsys_browse_id = ''$bid''";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Javascript Button''){\r\n    \r\n        $osql = "sob_all_type = ''button'', sob_all_height = 30, sob_all_width = 200";\r\n        $bsql = "";\r\n        $asql = "";\r\n        $s = "DELETE FROM zzzzsys_browse WHERE zzzzsys_browse_id = ''$bid''";\r\n        nuRunQuery($s);\r\n\r\n        $eid = nuID();\r\n        $s = "INSERT INTO zzzzsys_event (zzzzsys_event_id, sev_zzzzsys_object_id, sev_name, sev_javascript) VALUES (''$eid'',''$OO->zzzzsys_object_id'',''onclick'',''alert(123);'')";\r\n        nuRunQuery($s);\r\n        \r\n	}\r\n    if($OO->sob_all_type == ''Open Form Button''){\r\n    \r\n        $osql = "sob_all_type = ''button'', sob_all_height = 30, sob_all_width = 200, sob_button_zzzzsys_form_id = ''nudebug''";\r\n        $bsql = "";\r\n        $asql = "";\r\n        $s = "DELETE FROM zzzzsys_browse WHERE zzzzsys_browse_id = ''$bid''";\r\n        nuRunQuery($s);\r\n\r\n	}\r\n\r\n    if($osql != ''''){\r\n        \r\n        $s = "UPDATE zzzzsys_object SET $osql WHERE zzzzsys_object_id = ''$OO->zzzzsys_object_id'' ";\r\n        nuRunQuery($s);\r\n\r\n    }\r\n    \r\n    if($bsql != ''''){\r\n        \r\n        $s = "UPDATE zzzzsys_browse SET $bsql WHERE zzzzsys_browse_id = ''$bid''";\r\n        nuRunQuery($s);\r\n\r\n    }    \r\n    \r\n    if($asql != ''''){\r\n        \r\n        $s = "ALTER TABLE $FO->sfo_table $asql";\r\n        nuRunQuery($s);\r\n\r\n    }    \r\n}\r\n\r\n\r\nfunction nuFastFormForm($FO){\r\n\r\n    $t   = nuRunQuery("SELECT COUNT(*) FROM zzzzsys_form");\r\n    $r   = db_fetch_row($t);\r\n    $n   = $r[0];\r\n    $tn  = nuGetTableName();\r\n    $p   = $tn . ''_id'';\r\n    $b   = nuID();\r\n    $a   = nuID();\r\n\r\n    $s   = "\r\n    \r\n        UPDATE zzzzsys_form\r\n        SET\r\n        sfo_name = ''FF$n'', \r\n        sfo_sql = ''SELECT * FROM $tn'', \r\n        sfo_table = ''$tn'', \r\n        sfo_primary_key = ''$p'', \r\n        sfo_add_button = ''1'', \r\n        sfo_save_button = ''1'', \r\n        sfo_delete_button = ''1'', \r\n        sfo_clone_button = ''1'', \r\n        sfo_print_button = ''1''\r\n        WHERE zzzzsys_form_id = ''$FO->zzzzsys_form_id''\r\n        \r\n    ";\r\n\r\n    nuRunQuery($s);                                                                             //-- create new form\r\n\r\n    $s   = "\r\n    \r\n        INSERT INTO zzzzsys_object\r\n        (\r\n        zzzzsys_object_id, \r\n        sob_zzzzsys_form_id,\r\n        sob_all_name,\r\n        sob_all_type,\r\n        sob_all_title,\r\n        sob_all_tab_title,\r\n        sob_all_tab_number,\r\n        sob_all_column_number,\r\n        sob_all_order_number,\r\n        sob_all_clone,\r\n        sob_all_align,\r\n        sob_all_no_blanks,\r\n        sob_all_read_only,\r\n        sob_all_no_duplicates,\r\n        sob_all_width,\r\n        sob_all_height,\r\n        sob_button_zzzzsys_form_id\r\n        ) \r\n        VALUES \r\n        (\r\n        ''$b'', \r\n        ''nuhome'', \r\n        ''btn$tn'', \r\n        ''button'',\r\n        ''$FO->sfo_title'',\r\n        ''Home'',\r\n        ''10'',\r\n        ''10'',\r\n        ''10'',\r\n        ''1'',\r\n        ''l'',\r\n        ''0'',\r\n        ''0'',\r\n        ''0'',\r\n        ''200'',\r\n        ''30'',\r\n        ''$FO->zzzzsys_form_id''\r\n        )\r\n\r\n    ";\r\n\r\n    nuRunQuery($s);                                                             //-- add Form to Fast Form Access Level\r\n\r\n    $s   = "\r\n\r\n        INSERT INTO zzzzsys_access_level_form \r\n        (\r\n        zzzzsys_access_level_form_id, \r\n        slf_zzzzsys_access_level_id, \r\n        slf_zzzzsys_form_id \r\n        ) \r\n        VALUES\r\n        (\r\n        ''$a'', \r\n        ''nufastformlevel'', \r\n        ''$FO->zzzzsys_form_id''\r\n        );\r\n\r\n    ";\r\n\r\n    nuRunQuery($s);                                                             //-- add Button to Home\r\n    \r\n    \r\n    $s = "CREATE TABLE $tn ($p VARCHAR(25) NOT NULL, PRIMARY KEY ($p)) ENGINE = MyISAM";\r\n\r\n    nuRunQuery($s); //-- create new table\r\n\r\n    return $tn;        \r\n    \r\n}\r\n\r\nfunction nuGetTableName(){\r\n\r\n    $n = ''#sfo_title#'';\r\n    \r\n    $s = "\r\n    \r\n	SELECT TABLE_NAME\r\n	FROM INFORMATION_SCHEMA.TABLES\r\n	WHERE TABLE_SCHEMA = ''$db''\r\n	GROUP BY TABLE_NAME\r\n    \r\n    ";\r\n    \r\n    $t = nuRunQuery($s);\r\n    $a = array();\r\n    \r\n    while($r = db_fetch_row($t)){\r\n        $a[] = $r[0];\r\n    }\r\n\r\n    return nuGetUniqueName($n, $a);\r\n\r\n}\r\n\r\nfunction nuValidName($n){\r\n    \r\n    $v = preg_replace("/[^0-9a-zA-Z _]/", "", $n);\r\n    \r\n    return str_replace('' '', ''_'', strtolower($v));\r\n}\r\n\r\n\r\nfunction nuValidTitle($n){\r\n    \r\n    return trim(preg_replace("/[^0-9a-zA-Z _]/", "", $n));\r\n    \r\n}\r\n\r\n\r\nfunction nuGetUniqueName($name, $a){\r\n\r\n    $n = nuValidName($name);\r\n    \r\n    $c = '''';\r\n    \r\n    while(true){\r\n\r\n\r\n        if(array_search($n . $c, $a) == ''''){\r\n            return $n . $c;\r\n        }else{\r\n  \r\n            if($c == ''''){\r\n                $c = 1;\r\n            }else{\r\n                $c = $c + 1;\r\n            }\r\n\r\n       }\r\n       \r\n    }\r\n\r\n}\r\n\r\n', NULL, 'function nuFastFormObject(t){\n    \n    var r = $(''#'' + t.id).attr(''data-prefix'');\n    var p = $(''#'' + r + ''_nuPrimaryKey'').val();\n    \n    if(p == ''''){\n        alert(''This Fast Form must be saved first.'')\n    }else{\n        nuOpenFormInFrame(''nuobject'', p);\n    }\n    \n}\n\nfunction nuFastFormFormView(){\n    \n    var p = ''#RECORD_ID#'';\n    \n    if(p == ''-1''){\n        alert(''This Fast Form must be saved first.'')\n    }else{\n        nuOpenFormInFrame(p, ''-1'');\n    }\n    \n}\n\n\nfunction nuFastFormBrowseView(){\n    \n    var p = ''#RECORD_ID#'';\n    \n    if(p == ''-1''){\n        alert(''This Fast Form must be saved first.'')\n    }else{\n        nuOpenBrowseInFrame(p);\n    }\n    \n}\n\nfunction nuFastFormForm(){\n    \n    var p = ''#RECORD_ID#'';\n    \n    if(p == ''-1''){\n        alert(''This Fast Form must be saved first.'')\n    }else{\n        nuOpenFormInFrame(''nuform'', p);\n    }\n    \n}\n\nfunction nuLoadEdit(){ \n\n    nuPopulateFFSubform();\n    $(''#ff_talk'').html(nuTranslate(''"Add an Object to this Form"''));\n\n    \n}\n\nfunction nuHideLastSFRow(){ \n\n\n    var s = nuSubformArray(''fast_form_subform'', true);\n\n    $(''#'' + s[s.length-1] + ''_nuRow'').css(''visibility'', ''hidden'');\n    $(''#'' + s[s.length-1] + ''_nuDelete'').prop(''checked'', true)\n\n}\n\n\nfunction nuAddFFObject(pthis){\n\n    var s = nuSubformArray(''fast_form_subform'', true);\n    var r = s[s.length-1];\n\n    $("[id$=''fast_form_object_properties'']").val(''P'');\n    $(''#'' + r + ''_nuRow'').css(''visibility'', ''visible'');\n    $(''#'' + r + ''fast_form_object_description'').html(''&nbsp;'' + pthis.value + '' (''+ $(''#''+pthis.id).attr(''data-type'') + '')'');\n    $(''#'' + r + ''sob_all_type'').val($(''#''+pthis.id).val());\n    $(''#'' + r + ''sob_all_title'').val(pthis.value + '' '' + s.length);\n    $(''#'' + r + ''sob_all_title'').focus();\n\n    nuAddRow(''fast_form_subform'');\n\n    nuHideLastSFRow();\n\n    var o = String(pthis.value).toLowerCase().replaceAll('' '', ''_'', true);\n    \n}\n\n\nfunction nuPopulateFFSubform(){\n\n    var i = 0;\n    var r = '''';\n    var s = nuSubformArray(''fast_form_subform'', true);\n    \n    for(i = 0 ; i < s.length ; i++){\n        \n        $(''#'' + s[i] + ''_nuRow'').css(''visibility'', ''visible'');\n        $(''#'' + s[i] + ''_nuDelete'').prop(''checked'', false)\n        $(''#'' + s[i] + ''fast_form_object_description'').html(''&nbsp;'' + String($(''#'' + s[i] + ''sob_all_type'').val()).toUpperCase());\n    }\n\n    $("[id$=''fast_form_object_properties'']").val(''P'');\n    $("[id$=''fast_form_object_properties'']").attr(''title'',''Edit Properties'');\n    $("#fast_form_properties").attr(''title'',''Edit Properties'');\n    $("#fast_form_form_view").attr(''title'',''View Edit Form'');\n    $("#fast_form_browse_view").attr(''title'',''View Browse Form'');\n\n    nuHideLastSFRow();\n    \n}\n', NULL, 0, 0, '2015-03-11 12:21:31', 'globeadmin', '2015-04-15 12:04:02', 'globeadmin', '2015-04-15 12:04:02', 'globeadmin'),
