('nuemail', 'browse', 'EMAIL', 'Email', 'select * from zzzzsys_debug', 'zzzzsys_debug', 'zzzzsys_debug_id', 500, 300, '', '', '1', '', '', '', '', '', 'Send Email', '', '', '', '', '', '', '', '', '', '', 'if(''#replyto#'' == ''''){\r\n    nuDisplayError(''User must have an Email Address'');\r\n    return;\r\n}\r\n\r\n\r\n\r\nif(''#nu_pdf_code#''!='''') {\r\n    nuEmail(''#nu_pdf_code#'', ''#to#'', ''#subject#'',''#message#'', $hashData);\r\n}\r\nelse if(''#nu_php_code#''!='''') {\r\n    nuEmail(''#nu_php_code#'', ''#to#'', ''#subject#'',''#message#'', $hashData);\r\n}\r\nelse {\r\n    nuEmail('''', ''#to#'', ''#subject#'',''#message#'', $hashData);\r\n}', '', '', '', '', '', 'function nuLoadEdit(){\n\n   nuFORM.record_id = nuFORM.nu_previous_record_id;   //-- so pdf and php use the previous record_id\n\n   if(nuFORM.closedown != undefined){\n      nuRemoveModal();\n   }\n\n\n   nuFORM.closedown = 1;\n   if(nuFORM.nu_pdf_code != ''''){\n\n	   var mess = nuValidatePDF(nuFORM.nu_pdf_code);\n	   var m    = '''';\n\n	   if(mess.length > 0){\n\n		  for(var i = 0 ; i < mess.length ; i++){\n			  m = m + mess[i] + "\\r";\n		  }\n\n		  alert(m);\n		  nuRemoveModal();\n		  return;\n		  \n	   }\n	}\n\n   if(nuFORM.nu_php_code != ''''){\n\n	   var mess = nuValidatePHP(nuFORM.nu_php_code);\n	   var m    = '''';\n\n	   if(mess.length > 0){\n\n		  for(var i = 0 ; i < mess.length ; i++){\n			  m = m + mess[i] + "\\r";\n		  }\n\n		  alert(m);\n		  nuRemoveModal();\n		  return;\n		  \n	   }\n\n   }\n}', NULL, 0, 0, '2014-01-20 14:22:15', 'globeadmin', '2014-02-06 12:53:51', 'globeadmin', '2014-02-06 12:53:52', 'globeadmin');
INSERT INTO `zzzzsys_form` (`zzzzsys_form_id`, `sfo_type`, `sfo_name`, `sfo_title`, `sfo_sql`, `sfo_table`, `sfo_primary_key`, `sfo_width`, `sfo_height`, `sfo_breadcrumb`, `sfo_add_button`, `sfo_save_button`, `sfo_delete_button`, `sfo_clone_button`, `sfo_new_button`, `sfo_print_button`, `sfo_add_title`, `sfo_save_title`, `sfo_delete_title`, `sfo_clone_title`, `sfo_new_title`, `sfo_print_title`, `sfo_add_button_display_condition`, `sfo_save_button_display_condition`, `sfo_delete_button_display_condition`, `sfo_clone_button_display_condition`, `sfo_new_button_display_condition`, `sfo_print_button_display_condition`, `sfo_custom_code_run_before_save`, `sfo_custom_code_run_before_browse`, `sfo_custom_code_run_before_delete`, `sfo_custom_code_run_before_open`, `sfo_custom_code_run_after_save`, `sfo_custom_code_run_after_delete`, `sfo_custom_code_run_javascript`, `sfo_redirect_form_id`, `sfo_row_height`, `sfo_rows`, `zzzzsys_form_log_added_at`, `zzzzsys_form_log_added_by`, `zzzzsys_form_log_changed_at`, `zzzzsys_form_log_changed_by`, `zzzzsys_form_log_viewed_at`, `zzzzsys_form_log_viewed_by`) VALUES
