xtarea[id*=''sfo_custom_code_run'']").attr( ''wrap'', ''off'');\n\n        $("textarea[id*=''javascript'']").css(''background-color'', ''#CAE1FF'');\n        $("textarea[id*=''javascript'']").css(''font-family'', ''Courier New'');\n        $("textarea[id*=''javascript'']").css(''font-size'', ''14px'');\n        $("textarea[id*=''javascript'']").attr( ''wrap'', ''off'');\n\n        $("textarea[id*=''sob_html_code'']").css(''background-color'', ''#EEE4EC'');\n        $("textarea[id*=''sob_html_code'']").css(''font-family'', ''Courier New'');\n        $("textarea[id*=''sob_html_code'']").css(''font-size'', ''14px'');\n        $("textarea[id*=''sob_html_code'']").attr( ''wrap'', ''off'');\n        $("[id^=''nu_holder_sfo_custom_code_run_'']").css(''visibility'', ''hidden'');\n    }\n\n    });\n\n    function nuShowCode(pThis){\n\n        $("[id^=''sfo_custom_code_run_'']").css(''width'',      ''0px'');\n        $("[id^=''sfo_custom_code_run_'']").css(''height'',     ''0px'');\n        $("[id^=''sfo_custom_code_run_'']").css(''visibility'', ''hidden'');\n        $("[id^=''sfo_custom_code_run_'']").css(''visibility'', ''hidden'');\n        $("[id^=''nu_holder_sfo_custom_code_run_'']").css(''visibility'', ''hidden'');\n        $(".nuCodeTabsSelected").removeClass(''nuCodeTabsSelected'');\n\n        $("#sfo_custom_code_run_"+pThis.id.substr(7)).css(''width'',      ''900px'');\n        $("#sfo_custom_code_run_"+pThis.id.substr(7)).css(''height'',     ''400px'');\n        $("#sfo_custom_code_run_"+pThis.id.substr(7)).css(''visibility'', ''visible'');\n        $("#nu_holder_sfo_custom_code_run_"+pThis.id.substr(7)).css(''visibility'', ''visible'');\n        $("#"+pThis.id).addClass(''nuCodeTabsSelected'');\n    }   \n\n    function nuPopulateSort(t){\n\n        var p = ''#'' + $(''#''+t.id).attr(''data-prefix'') + ''sbr_sort'';\n        if($(p).val() == ''''){\n        $(p).val(t.value)\n        \n    }\n\n    }', '', 0, 0, '0000-00-00 00:00:00', '', '2015-04-14 11:42:50', 'globeadmin', '2015-04-14 11:42:50', 'globeadmin'),
('nuformsandsubforms', 'browse', 'fsf', 'Forms And Subforms', 'SELECT * FROM #TABLE_ID#\nORDER BY thecode', '#TABLE_ID#', 'theid', 900, 0, '', '0', '0', '0', '0', '0', '0', '', '', '', '', '', '', '', '', '', '', '', '', '', '\r\n$s = "\r\nCREATE TABLE #TABLE_ID# \r\nSELECT \r\nzzzzsys_form_id AS theid, \r\nsfo_name      AS thecode, \r\nsfo_title     AS thedesc \r\nFROM zzzzsys_form \r\nWHERE (zzzzsys_form_id NOT LIKE ''#nu_denied#'' OR zzzzsys_form_id = ''nuhome'')\r\n\r\n\r\n";\r\n\r\nnuRunQuery($s);\r\n\r\n\r\n$s = "\r\nINSERT INTO #TABLE_ID#  \r\nSELECT \r\nzzzzsys_object_id                    AS theid, \r\nsob_all_name                       AS thecode,\r\nCONCAT(''Subform of : '', sfo_title) AS thedesc\r\nFROM zzzzsys_object\r\nINNER JOIN zzzzsys_form ON sob_zzzzsys_form_id = zzzzsys_form_id\r\nWHERE sob_all_type = ''subform''\r\nAND sob_zzzzsys_form_id NOT LIKE ''#nu_denied#''\r\n";\r\n\r\nnuRunQuery($s);\r\n', '', '', '', '', '', '', 0, 0, '0000-00-00 00:00:00', '', '2013-10-10 14:10:11', 'globeadmin', '2015-04-14 11:31:29', 'globeadmin'),
('nusubformwizard', 'browse', 'SFW', 'Subform Wizard', 'select * from zzzzsys_debug', 'zzzzsys_debug', 'zzzzsys_debug_id', 0, 600, '', '', '1', '', '', '', '', '', 'Create Subform', '', '', '', '', '', '', '', '', '', '', 'function getProperties($attr) {\r\n    \r\n    $type   = ''text'';\r\n    $height = '''';\r\n    $width  = $attr[3];\r\n    $title  = $attr[4];\r\n    $lookup = $attr[5];\r\n    $lc     = $attr[6];\r\n    $ld     = $attr[7];\r\n    $align  = ''l'';\r\n    $format = '''';\r\n    \r\n    switch ($attr[1]) {\r\n        case ''date'':\r\n            $format = ''6'';\r\n            break;\r\n        case ''int'':\r\n            $align  = ''r'';\r\n            $format = ''0'';\r\n            break;\r\n        case ''double'':\r\n            $align = ''r'';\r\n            if($attr[2] <= 5) {\r\n                $format = $attr[2];\r\n            }\r\n            else {\r\n                $format = ''5'';\r\n            }\r\n            break;\r\n        case ''decimal'':\r\n            $align = ''r'';\r\n            if($attr[2] <= 5) {\r\n                $format = $attr[2];\r\n            }\r\n            else {\r\n                $format = ''5'';\r\n            }\r\n            break;\r\n        case ''text'':\r\n            $type   = ''textarea'';\r\n            $height = ''150'';\r\n            $width  = ''250'';\r\n            break;\r\n    } \r\n      \r\n      \r\n    if( $lookup != '''' ) {\r\n        $type = ''lookup'';\r\n    }\r\n    \r\n    $values = array(\r\n        "align"   => $align,\r\n        "format"  => $format,\r\n        "width"   => $width,\r\n        "title"   => $title,\r\n        "height"  => $height,\r\n        "type"    => $type,\r\n        "lookup"  => $lookup,\r\n        "lc"      => $lc,\r\n        "ld"      => $ld\r\n    );\r\n    \r\n    return $values;\r\n}\r\n\r\n\r\n$subform = nuID();\r\n$form    = ''#sfw_form_id#'';\r\n$table   = ''#sfw_table_name#'';\r\n$primary = ''#sfw_hidden_primary#'';\r\n$foreign = ''#sfw_foreign_key#'';\r\n$type    = ''#sfw_subform_type#'';\r\n\r\n$sql     = "SELECT * FROM $table WHERE $foreign = ''#".''RECORD_ID''."#''";\r\n\r\n$fields  = ''#sfw_form_listbox#'';\r\n$fieldarr  = explode(''#nuSep#'', $fields);\r\n\r\nif( $table === '''' || $primary === '''') {\r\n    nuDisplayError(''A table needs to be chosen.'');\r\n    return;\r\n}\r\n\r\nif( $fields === '''' ) {\r\n    nuDisplayError(''At least one field must be chosen.'');\r\n    return;\r\n}\r\n\r\nif( $form === '''' ) {\r\n    nuDisplayError(''No form selected'');\r\n    return;\r\n}\r\n\r\nif( $foreign === '''' ) {\r\n    nuDisplayError(''No foreign key selected'');\r\n    return;\r\n}\r\n\r\n$fieldarr  = explode(''#nuSep#'', $fields);\r\n$allfields = array();\r\n\r\nforeach($fieldarr as $value) {\r\n    $allfields[] = explode(''#nuSepr#'', $value);\r\n}\r\n\r\nif( $type === '''' ) {\r\n    $type = ''g'';\r\n}\r\nelse if( $type === ''f'' ) {\r\n    $height = 50*count($fieldarr);\r\n}\r\n\r\n//build subform object\r\n$s = "\r\n    INSERT INTO zzzzsys_object (zzzzsys_object_id, sob_zzzzsys_form_id, sob_all_access_key, sob_all_title, sob_all_name, sob_all_tab_title, sob_all_tab_number, sob_all_column_number, sob_all_order_number, sob_all_top, sob_all_left, sob_all_width, sob_all_height, sob_all_clone, sob_all_align, sob_all_no_blanks, sob_all_no_duplicates, sob_all_read_only, sob_all_type, sob_subform_table, sob_subform_primary_key, sob_subform_foreign_key, sob_subform_addable, sob_subform_deletable, sob_subform_type, sob_subform_sql, sob_subform_row_height) VALUES\r\n    (''$subform'', ''$form'','''', ''".$table."_subform'',''".$table."_subform'',''Wizard'', ''12345'',''10'',''10'',''10'', ''10'',''900'',''300'',''1'',''l'',''0'',''0'',''0'',''subform'',''$table'', ''$primary'', ''$foreign'',''1'',''1'',''$type'',''".addslashes($sql)."'', ''20'')\r\n";\r\nnuRunQuery($s);\r\n\r\n\r\n$s = "\r\n    INSERT INTO zzzzsys_object (zzzzsys_object_id, sob_zzzzsys_form_id, sob_all_column_number, sob_all_name, sob_all_order_number, sob_all_tab_number, sob_all_tab_title, sob_all_title, sob_all_type, sob_all_width, sob_all_height, sob_all_align, sob_text_format, sob_all_no_blanks, sob_all_read_only, sob_all_no_duplicates, sob_all_clone, sob_lookup_code_field, sob_lookup_description_field, sob_lookup_zzzzsys_form_id, sob_lookup_id_field, sob_lookup_code_width, sob_lookup_description_width) VALUES\r\n    \r\n";\r\n\r\n$o = 10;\r\n$c = 10;\r\n$hasTextArea = false;\r\n\r\nfor( $idx = 0; $idx < count($allfields); $idx++ ) {\r\n    $prim  = nuID();\r\n    $field = $allfields[$idx];\r\n    $prop  = getProperties($field);\r\n    $form_id = '''';\r\n    \r\n    if( $prop["lookup"] !== '''' ) {\r\n        $sq = "SELECT sfo_primary_key FROM zzzzsys_form WHERE zzzzsys_form_id = ?";\r\n        \r\n        $qry = nuRunQuery($sq, array($prop["lookup"]));\r\n        $res = db_fetch_object($qry);\r\n        $form_id = $res->sfo_primary_key;\r\n    }\r\n    if( $prop["type"] == ''textarea'' and $type == ''g'' and !$hasTextArea) {\r\n        $sq = "UPDATE zzzzsys_object SET sob_subform_row_height=''175'' WHERE zzzzsys_object_id = ''$subform''";\r\n        nuRunQuery($sq);\r\n        $hasTextArea = true;\r\n    }\r\n    \r\n    $s .= "( ''$prim'', ''$subform'', ''$c'', ''".$field[0]."'', ''$o'', ''10'', ''Details'', ''".$prop[''title'']."'', ''".$prop[''type'']."'', ''".$prop[''width'']."'',''".$prop[''height'']."'',  ''".$prop[''align'']."'', ''".$prop[''format'']."'', ''0'',''0'',''0'',''1'', ''".$prop["lc"]."'', ''".$prop["ld"]."'', ''".$prop["lookup"]."'', ''".$form_id."'', ''100'', ''250''), ";\r\n    \r\n    $o = $o + 10;\r\n    if( $o >= 150 ) {\r\n        $o = 10;\r\n        $c = $c + 10;\r\n    }\r\n}\r\n$s = rtrim($s, '', '');\r\nnuRunQuery($s);\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_top = ''0'' WHERE sob_all_top IS NULL;");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_left = ''0'' WHERE sob_all_left IS NULL;");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_clone = ''0'' WHERE sob_all_clone IS NULL;");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_align = ''0'' WHERE sob_all_align IS NULL;");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_no_blanks = ''0'' WHERE sob_all_no_blanks IS NULL;");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_read_only = ''0'' WHERE sob_all_read_only IS NULL;");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_align = ''l'' WHERE sob_all_align IS NULL;");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_no_duplicates = ''0'' WHERE sob_all_no_duplicates IS NULL;");\r\n\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_top = ''0'' WHERE sob_all_top = '''';");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_left = ''0'' WHERE sob_all_left = '''';");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_clone = ''0'' WHERE sob_all_clone = '''';");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_align = ''0'' WHERE sob_all_align = '''';");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_no_blanks = ''0'' WHERE sob_all_no_blanks = '''';");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_read_only = ''0'' WHERE sob_all_read_only = '''';");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_align = ''l'' WHERE sob_all_align = '''';");\r\nnuRunQuery("UPDATE zzzzsys_object SET sob_all_no_duplicates = ''0'' WHERE sob_all_no_duplicates = '''';");\r\n\r\n', '', '', '$sql = "\nSELECT TABLE_NAME, COLUMN_NAME, COLUMN_KEY, DATA_TYPE, NUMERIC_SCALE, NUMERIC_PRECISION, CHARACTER_MAXIMUM_LENGTH\nFROM INFORMATION_SCHEMA.COLUMNS\nWHERE TABLE_SCHEMA = database()\n";\n\n$js = "function fetch_columns() {window.columns = [";\n\n$q = nuRunQuery($sql);\n\n$r = db_fetch_array($q);\n\n$js .= "[\\"" . $r[0] . "\\" , \\"" . $r[1] . "\\" , \\"" . $r[2] . "\\" , \\"" . $r[3] . "\\" , \\"" . $r[4] . "\\" , \\"" . $r[5]. "\\" , \\"" . $r[6] . "\\"]";\nwhile($r = db_fetch_array($q)) {\n    $js .= ",[\\"" . $r[0] . "\\" , \\"" . $r[1] . "\\" , \\"" . $r[2] . "\\" , \\"" . $r[3] . "\\" , \\"" . $r[4] . "\\" , \\"" . $r[5]. "\\" , \\"" . $r[6]. "\\"]";\n}\n$js .= "];}";\n\nnuAddJavascript($js);', '', '', 'function nuLoadEdit() {\n    $(''#sfw_table_listbox'').empty();\n    $(''#sfw_form_listbox'').empty();\n    $(''#nuBreadCrumb_1'').remove();\n    $(''#nuArrow_0'').remove();\n    $(''#sfw_form_up'').val($(''<div>'').html(''&uarr;'').text());\n    $(''#sfw_form_down'').val($(''<div>'').html(''&darr;'').text());\n}\n\nfunction selectAll(listbox) {\n    var select = $(''#''+listbox);\n    $(''option'', select).prop(''selected'', 1);\n}\n\nfunction nuOnSave() {\n    selectAll(''sfw_form_listbox'');\n    $(''#sfw_form_listbox option'').each(function() {\n        var ed_width = $(this).attr(''nu_ed_width'');\n        var ed_title = $(this).attr(''nu_ed_title'');\n        var lookup   = $(this).attr(''nu_lookup'');\n        var lc       = $(this).attr(''nu_lookup_code'');\n        var ld       = $(this).attr(''nu_lookup_description'');\n        var value = $(this).attr(''value'');\n        $(this).attr(''value'', value+''#nuSepr#''+ed_width+''#nuSepr#''+ed_title+''#nuSepr#''+lookup+''#nuSepr#''+lc+''#nuSepr#''+ld);\n    });\n    return true;\n}', NULL, 0, 0, '2014-01-31 15:34:09', 'globeadmin', '2014-02-11 13:01:54', 'globeadmin', '2014-02-11 13:01:54', 'globeadmin'),
