('55494eebbb1c5d0', '', 'FF24', 'Customer', 'SELECT * FROM customer', 'customer', 'customer_id', 0, 0, '', '1', '1', '1', '1', NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, NULL, '\nfunction set_child_filter(t){\n    \n    var p = t.getAttribute(''data-prefix'');\n    var v = $(''#''+p+''_nuPrimaryKey'').val();\n    \n    if(v == ''''){\n        alert(''This child has not been saved'');\n        $(''#the_id'').val(''______________'');   //-- filters everything \n    }else{\n        $(''#the_id'').val(v);\n    }\n}\n\n\n\nfunction nuObjectDraggableDialog(w) {\n\n	var e = document.createElement(''div'');              //-- create draggable div\n	e.setAttribute(''id'', ''nuDrag'');\n	$(''body'').append(e);\n	$(''#'' + e.id).css({\n		''width''            : w,\n		''height''           : 450,\n		''top''              : 50,\n		''left''             : 20,\n		''position''         : ''absolute'',\n		''background-color'' : ''#E1E8EA'',\n		''z-index''          : 5000,\n		''border-width''     : ''0px'',\n		''border-color''     : ''#01A6F5'',\n		''border-style''     : ''solid'',\n		''filter''           : ''Alpha(Opacity=100)'',\n		''opacity''          : ''1'',\n		''box-shadow''       : ''5px 5px 5px #888888''\n	});\n\n}\n\n\n\nfunction testtt(){\n\n    init();\n\n}\n\n\nfunction init() {\n  \nvar public_spreadsheet_url = prompt(''Import Google Spreadsheet URL:'');\n\n    Tabletop.init( { key: public_spreadsheet_url,\n         callback: showInfo,\n         simpleSheet: true } );\n    }\n\n\nfunction showInfo(data, tabletop) {\n    \n    alert("Successfully processed!")\n    console.log(JSON.stringify(data));\n    \n}\n', NULL, 0, 0, '2015-05-06 08:44:52', 'globeadmin', '2015-11-05 09:13:41', 'globeadmin', '2015-11-05 09:21:30', 'globeadmin'),
('nugoogless', '', 'gss', 'Google Spreadsheet', 'SELECT * FROM zzzzsys_debug', 'zzzzsys_debug', 'zzzzsys_debug_id', 0, 0, '', NULL, '1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '$s = json_decode(nuGetJSONSubform(''fldsf''));\n$j = str_replace("u0027", "\\\\u0027", ''#ssta#'');\n$j = str_replace(''\\"'', ''"'', $j);\n$d = json_decode($j);\n$l = nuLongestFields($d->rows);\n\n\n\nnudebug(print_r($l,1));\nnudebug(print_r($d->columns,1));\n//nudebug($s[0]->wastxt);\n\n\nfunction nuLongestFields($rws){\n\n    $a = array();\n\n   foreach($rws[0] as $key => $value) {\n       $a[$key] = 0;\n   }\n    \n    for($i = 0 ; $i < count($rws) ; $i++){\n\n       foreach($rws[$i] as $key => $value) {\n           $a[$key] = max($a[$key], strlen($value));\n       }\n\n    }\n    \n    return $a;\n}\n', NULL, '', NULL, NULL, NULL, 'function nuLoadEdit(){\n\n    var s = nuSubformArray(''fldsf'', true);\n\n    $(''#'' + s[s.length-1] + ''_nuRow'').css(''visibility'', ''hidden'');\n    $(''#'' + s[s.length-1] + ''_nuDelete'').prop(''checked'', true);\n    \n    \n}\n\n\n\nfunction nuGoogleSS() {\n  \n    var public_spreadsheet_url = $(''#urltxt'').val();\n\n    Tabletop.init({ key: public_spreadsheet_url, callback: nuPopulateSF, simpleSheet: false  });\n    \n}\n\n\nfunction nuPopulateSF(data, tabletop) {\n\n    var o         = {};\n\n    for (var key in data) {\n\n        o.columns = data[key].column_names;\n        o.rows    = data[key].elements;\n        var str   = String(JSON.stringify(o)).replaceAll( "''","u0027")\n\n        $(''#nmetxt'').val(data[key].name);\n        $(''#ssta'').val(str);\n        \n        break;\n            \n    }\n\n    for (var i = 0 ; i < o.columns.length ; i++){\n\n        var s = nuSubformArray(''fldsf'', true);\n\n        $(''#'' + s[s.length-1] + ''wastxt'').val(o.columns[i]);\n        $(''#'' + s[s.length-1] + ''nmetxt'').val(o.columns[i]);\n        $(''#'' + s[s.length-1] + ''_nuRow'').css(''visibility'', ''visible'');\n\n        nuAddFieldRow();\n\n    }\n\n    alert("Successfully processed!");\n    \n}\n\n\n\nfunction nuAddFieldRow(){\n\n    nuAddRow(''fldsf'');\n    \n    var s = nuSubformArray(''fldsf'', true);\n\n    $(''#'' + s[s.length-1] + ''_nuRow'').css(''visibility'', ''hidden'');\n    $(''#'' + s[s.length-1] + ''_nuDelete'').prop(''checked'', true)\n\n}\n\n', NULL, 0, 0, '2015-05-06 14:32:55', 'globeadmin', '2015-06-04 10:26:04', 'globeadmin', '2015-06-04 10:26:04', 'globeadmin'),
